def anti_debug():
    try:
        import time
        start = time.time()
        time.sleep(0.01)
        if time.time() - start > 0.1:
            sys.exit("Debugger Detected")
        if sys.platform == "win32":
            import ctypes
            if ctypes.windll.kernel32.IsDebuggerPresent():
                sys.exit("Debugger Detected")
        elif sys.platform == "linux":
            with open('/proc/self/status', 'r') as f:
                if 'TracerPid:\t0' not in f.read():
                    sys.exit("Debugging Detected")
    except:
        pass

anti_debug()

def derive_key(password: bytes, salt: bytes, length: int = 32) -> bytes:
    return PBKDF2(password, salt, dkLen=length, count=100000, hmac_hash_module=SHA256)

